import React from 'react';
import './WhatsAppButton.module.scss'; // Importe o arquivo CSS com os estilos do botão do WhatsApp

const WhatsAppButton = () => {
  const handleClick = () => {
    window.open('https://api.whatsapp.com/send?phone=905309171112&text=Merhaba', '_blank');
  };

  return (
    <div>
      <div className="pulse"></div>
      <div className="pulse"></div>
      <div className="pulse"></div>
      <a style={{ color: '#fff' }} href="https://api.whatsapp.com/send?phone=905309171112&text=Merhaba" target="_blank" rel="noopener noreferrer" className="whatsapp-info pulse" onClick={handleClick}>
        <span className="whatsapp">
          <i className="fa fa-whatsapp"></i>
        </span>
      </a>
    </div>
  );
};

export default WhatsAppButton;
